import React from 'react'
import  logo from './logoMN.png';
const Header = () => {
  return (
    <>
      <div>
        <img src={logo} alt="logo" width='70' height='50' />
        <h1>Narmeen</h1>
      </div>
      
    </>
  );
};

export default Header;
